import React from 'react';
import "./HistoryPage.css"

const styles = {
  table: {
    borderCollapse: 'collapse',
    width: '100%',
  },
  thtd: {
    border: '1px solid black',
    padding: '8px',
    textAlign: 'left',

  }
};

const HistoryPage = ({ historyRecords }) => {
  return (
    <div>
      <h1>История запросов</h1>
      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.thtd}>ID</th>
            <th style={styles.thtd}>Даты и время запроса</th>
            <th style={styles.thtd}>Nickname</th>
          </tr>
        </thead>
        <tbody>
          {historyRecords.map((record) => (
            <tr key={record.request_id}>
              <td style={styles.thtd}>{record.request_id}</td>
              <td style={styles.thtd}>{record.request_date}</td>
              <td style={styles.thtd}>{record.nickname}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <br />
      <button onClick={() => window.location.href = '/'}>Вернуться к поиску</button>
    </div>
  );
};

export default HistoryPage;
